### Summary of Core Topics and Concepts

#### Java Programming Concepts
1. **Inheritance and Polymorphism**
   - Method overriding and the use of `super` keyword.
   - Polymorphic behavior in method calls.
   - Example: `super.login();` and method overriding in `User` and `Admin` classes.

2. **Constructors and Initialization**
   - Constructor chaining using `super`.
   - Initialization of fields in parent and child classes.
   - Example: `super(n);` in the `Dog` class constructor.

3. **Control Structures**
   - `switch` statements and `for` loops.
   - Example: `switch (i)` and `for (int i = 0; i < 3; i++)`.

4. **Interfaces and Abstract Classes**
   - Default methods in interfaces.
   - Implementing and extending interfaces and abstract classes.
   - Example: `interface Printable` and `abstract class Displayable`.

5. **Type Casting and Instance Checking**
   - Using `instanceof` for type checking.
   - Casting objects to specific types.
   - Example: `if (acc instanceof PremiumSavingsAccount)`.

6. **Access Modifiers and Encapsulation**
   - Private, protected, and public access modifiers.
   - Encapsulation of class fields and methods.
   - Example: `private String name;` and `public void show();`.

7. **Method Overloading and Overriding**
   - Overloading methods with different parameters.
   - Overriding methods in child classes.
   - Example: `login()` and `login(String code)` methods.

8. **Activation Records and Call Stack**
   - Understanding the call stack and activation records.
   - Recursion and stack depth.
   - Example: `methodA`, `methodB`, and `methodC` recursive calls.

9. **Final Keyword**
   - Final methods and variables.
   - Example: `public final double calculateIncome()`.

10. **Object-Oriented Design Principles**
    - Designing classes and interfaces for specific behaviors.
    - Example: `interface Navigator` and `class BookShelf`.

